import React from "react";
import { Link } from "react-router-dom";

const Page404 = () => {
  return (
    <div className="page-404">
      <h1>404 - Page Not Found</h1>
      <p>The page you are looking for does not exist.</p>
      <Link to="/">Go to Home</Link>
    </div>
  );
};

export default Page404;
